import { Component } from 'react'

import './carrousel.css'

class Carrousel extends Component {
  constructor(props) {
    super(props)
    this.state = {
      classNameDropContent: 'close',
      classNameArrow: '',
    }
  }
  render() {
    return <div className="carrousel"></div>
  }
}

export default Carrousel
